8563	 A is not correct because it's not necessarily true, as stated in our first premise: while they can double every year (they'd quadruple in two years), this may not happen because of territory issues.   B can be eliminated because we're explicitly told in the argument that lone wolves are "unable to establish a territory near their place of origin". This does not mean that they're expelled from the pack just because the pack has doubled - maybe some wolves are chased away from the pack before the number doubles...   While we may feel like C is right because we know it's true from experience, there's nothing in the argument to suggest human encroachment on the wolves' territory.   D is actually the correct answer here. Even if some wolves are hunted down by humans, since the pack can double every year, the loss of a few wolves will be offset by the birth of new wolves. Take an example: suppose you start out with a pack of 15 wolves in a certain territory. 7 of them became aggressive and they had to be hunted down. We're left with 15 - 7 = 8 wolves in the pack. It's a great loss, but by the end of the year the pack can double. So the new number of wolves will be 2*8 = 16 wolves, which is pretty close to 15.   E kindda contradicts the passage. If the wolves double every year in a certain territory that's not yet full, then the density gets bigger and bigger.   Hope you liked this one! Smile	2015-01-06 04:58:41.788995	chat	2	2	0	1197,1200,1201	81	1200	613	5	10
