101	2014-11-09 01:31:23.120238	2014-11-09 01:31:23.120238	Helen Hacker is creating a Ruby application to keep track of her favorite books and plays.  She decides to create separate Ruby classes for <tt>Book</tt> and <tt>Play</tt>, because even though both have a <tt>title</tt> and <tt>author</tt>, they are otherwise very different: for example, a <tt>Play</tt> has an <tt>opening_date</tt>, <tt>number_of_acts</tt>, and other attributes that don't apply to a Book.\r\n<br>\r\nOne function she needs to implement is to sort a list of books and plays by their title, that is, to sort a collection that may contain both instances of <tt>Book</tt> and instances of <tt>Play</tt>.\r\nWhat design should she use to solve this problem in Ruby?\r\n	---\n- ! "<tt>Book</tt> and <tt>Play</tt> must be subclasses of some common ancestor, such\n  as <tt>Manuscript</tt>; this ancestor class should provide a <tt>sort</tt> method\n  that can recognize and handle either the <tt>Book</tt> or <tt>Play</tt> subclass.\\r\\n"\n- As long as <tt>Book</tt> and <tt>Play</tt> both have an attribute named <tt>title</tt>,\n  Helen can use the <tt>sort_by</tt> method to write something like <tt>sorted = list_of_works.sort_by\n  { |work| work.title }</tt>\n- Helen must create a separate instance method in either <tt>Book</tt> or <tt>Play</tt>\n  and use that that method to do the sorting.\n- Since not all the elements to be sorted are of the same type, Helen must create\n  a variant of Ruby's existing <tt>sort</tt> method (in the standard library) that\n  can handle a mixed collection.\n- Since not all the elements to be sorted are of the same type, Helen must separate\n  the collection into two collections (one containing only <tt>Book</tt>s and the\n  other containing only <tt>Play</tt>s), sort each collection, then recombine the\n  two sorted collections.\n	1	Because of duck typing, the solution using <tt>sort_by</tt> will work as long as any object passed to the sorting method can respond to <tt>title</tt>.  This solution is economical because it doesn't require us to give <tt>Book</tt> and <tt>Play</tt> a common ancestor just to enable sorting, and because it allows us to reuse existing methods like <tt>sort_by</tt> that are part of Ruby's standard library (in the <tt>Enumerable</tt> module).
102	2014-11-09 02:44:43.11444	2014-11-09 02:44:43.11444	In Ruby code, you will see <tt>Math::PI</tt> for the constant pi (3.1415...), but <tt>Math.sin</tt> for the sine of an angle. Which of the following are correct explanations for this difference:<br/>\r\n&nbsp;&nbsp; i.  PI is a constant, sin is a method <br/>\r\n&nbsp;&nbsp;         ii. PI is a symbol, sin is a method <br/>\r\n&nbsp;&nbsp;         iii. It’s just due to convention;  <tt>Math::sin</tt> and <tt>Math.PI</tt> would work just as well	---\n- (i) only\n- (ii) only\n- (i) and (iii) only\n- (ii) and (iii) only\n- (iii) only\n	0	Only a method name can follow a dot; and PI must be a constant, not a symbol, since a symbol cannot have a numeric value.
