104	2014-11-22 20:01:56.500903	2014-11-22 20:01:56.500903	Consider the two HTTP requests: <tt>GET /widget/scan</tt> and <tt>POST /widget/scan</tt>.  Which statement best describes the relationship between these two requests as they pertain to a Rails SaaS app?	---\n- These two requests are indistinguishable to a Rails controller, so they would be\n  handled by the same controller action.\n- These requests are distinguishable, so different controller actions would be necessary\n  to handle them.\n- These requests are distinguishable, and the app developer must decide whether they\n  should be handled by the same controller action or by two different controller actions.\n- Both requests are invalid because neither includes an ID to identify which RESTful\n  resource they operate on.\n- The mapping from routes to controller actions is entirely determined by the rules\n  in <tt>routes.rb</tt>; creating URI routes that match the names of controllers is\n  a convention, but not a requirement.\n	2	They are distinguishable because they use different HTTP verbs (<tt>GET</tt> vs. <tt>POST</tt>) even though the URI is the same.  The developer-specified rules in <tt>routes.rb</tt> determine whether the two routes should map to the same or different controller actions.  Although neither request appears to include a primary-key ID if a resource, there are many ways to name a RESTful resource besides an ID, and in addition, not all RESTful oeprations require an ID: for example, perhaps these requests are intended to list all widgets or update the modification time on all widgets, respectively.
105	2014-11-22 20:03:32.586358	2014-11-22 20:03:32.586358	Which of the following would be effective ways to store information between requests from the same user in a Rails SaaS app:<br/>\r\n(i) Class variable of a controller<br/>\r\n(ii) Instance variable of a controller<br/>\r\n(iii) <tt>session[]</tt> hash<br/>	---\n- (i) and (ii) only\n- (i) and (iii) only\n- (ii) and (iii) only\n- (i), (ii), and (iii)\n- (iii) only\n	4	Since HTTP is stateless, neither class nor instance variables of controllers retain their values across different requests, which is why Rails takes special steps to store the <tt>session</tt> in persistent storage between requests.  Depending on the production environment, such temporary session data might be stored in a database table, in the file system, or in some other non-volatile storage.
106	2014-11-22 20:05:01.102664	2014-11-22 20:05:01.102664	Which statement is NOT true regarding Rails RESTful routes and the resources to which they refer?	---\n- A resource may be existing content or a request to modify something.\n- In an MVC app, every route must eventually trigger a controller action.\n- One common set of RESTful actions is the CRUD actions on models.\n- The route always contains one or more 'wildcard' parameters such as :id to identify\n  the particular resource instance used in the operation.\n	3	Some routes that operate on collections, such as <tt>GET /movies</tt>, do not need any wildcard parameters.
107	2014-11-22 20:13:29.649514	2014-11-22 20:13:29.649514	Which ONE of the following statements is true about implicit requirements and explicit requirements?	---\n- You cannot write user stories for both explicit and implicit requirements\n- Implicit requirements tend to be more concise, while explicit requirements tend\n  to be more verbose\n- Implicit requirements are the logical consequence of explicit requirements, but\n  they can still be tested with user stories\n- Explicit requirements are usually defined with imperative scenarios and implicit\n  requirements are usually defined with declarative scenarios\n	2	Implicit and explicit requirements can generally be tested using the same kinds of mechanisms, including user stories, even though customers typically focus on explicit requirements in their stories.  The choice of imperative vs. declarative scenario is orthogonal to this distinction, and the right choice depends on the type of requirement functionality being tested.
108	2014-12-01 00:15:41.243897	2014-12-01 00:15:41.243897	In RottenPotatoes, creating a movie involves two steps: viewing and\r\nfilling in the HTML form associated with the <tt>new</tt> action, and\r\nsubmitting that form to the <tt>MoviesController#create</tt> action to\r\ntrigger the logic that creates a new movie record in the database.\r\nWhich of the following behaviors would you <b>NOT</b> expect to be tested in a\r\nset of controller (functional) specs for movie creation?	---\n- ! "Given legal <tt>params</tt>, check that the appropriate creation\\r\\naction in\n  the <tt>Movie</tt> model is invoked"\n- ! "Given legal <tt>params</tt>, check that a movie corresponding to\\r\\nthose params\n  actually gets created in the test database"\n- ! "Given the user fills in the New Movie form, check that the form\\r\\nelements'\n  values are properly passed to the controller action via the\\r\\n<tt>params</tt> hash"\n- ! "Given illegal <tt>params</tt>, check that an appropriate error is\\r\\nsignaled\n  rather than calling any creation logic in the <tt>Movie</tt>\\r\\nmodel"\n- ! "Given legal <tt>params</tt>, check that following the successful\\r\\ncreation\n  of a movie, the user is redirected to an appropriate page where\\r\\nconfirmation\n  may be displayed"\n	2	The marshaling of HTML elements into <tt>params</tt>\r\nis the responsibility of the routing subsystem, so a routing spec would be more\r\nappropriate for testing that.  All the other tasks are testing behaviors\r\nfor which the controller is responsible, so would be appropriate specs\r\nin a set of tests for the Movies controller.
109	2014-12-01 00:21:53.974587	2014-12-01 00:21:53.974587	Which of the following lists the kinds of tests in order of increasing code exercise complexity?	---\n- unit tests, functional or module tests, integration tests\n- integration tests, functional or module tests, unit tests\n- unit tests, integration tests, functional or module tests\n- functional or module tests, unit tests, integration tests\n	0	Unit tests focus on a single behavior, often within a\r\nparticular method. Functional or module tests focus on a behavior that\r\nmay involve several methods or even several classes. Integration tests\r\nexercise many subsystems of the application, or even the entire\r\napplication itself.
110	2014-12-01 00:33:47.013189	2014-12-01 00:33:47.013189	RSpec's <tt>stub</tt> method can be used to override what kinds of\r\nmethod calls in a test?	---\n- Only instance methods on a model, such as stubbing <tt>Movie#released_1930_or_later</tt>\n- ! "Only instance or class methods on a model, such as stubbing\\r\\n<tt>Movie#released_1930_or_later</tt>\n  or <tt>Movie.find</tt>"\n- ! "Only class or instance methods that are not inherited;\\r\\nfor example, we can\n  stub <tt>Movie#released_1930_or_later</tt>, but we\\r\\ncannot stub <tt>Movie.find</tt>\n  because <tt>find</tt> is inherited from <tt>ActiveRecord::Base</tt>"\n- Only instance methods on a controller, such as <tt>MoviesController#create</tt>)\n- It can be used to stub any method on any Ruby object\n	4	RSpec exploits Ruby's dynamic language features to stub any method at\r\nall at testing time, which is one reason it is relatively easy to write\r\nthorough tests with it.
99	2014-10-20 04:24:39.453062	2014-12-28 10:38:39.797527	The rate of health complications of patients on intravenous (IV) therapy at a particular hospital was higher than usual. Government inspectors found that the typical IV solutions used in this hospital had somewhat high concentrations of sodium and potassium, which were raising patients' blood pressure and taxing their kidneys. The government inspectors mandated lowering the sodium and potassium in these IV preparations, and threatened with a possible government fine.  In compliance, the hospital lowered the sodium and potassium levels in the IV solutions to the correct levels.  Nevertheless, patients on IV therapy at that hospital continued to have a high rate of health complications. Which of the following, if true, most helps to explain why acting on the government inspectors' recommendations failed to achieve its goal?\r\n	---\n- The change in IV solution procedure meant a number of related legal documents had\n  to be renegotiated and rewritten, at great cost.\n- When sodium and potassium levels in the blood fall below their baseline level, it\n  can damage cells throughout the body by reverse osmosis.\n- It is typical for a patient's appetite to increase to healthy levels once they have\n  completed a course of IV therapy.\n- A high proportion of patients at this hospital are older, and older patients are\n  more vulnerable to infections that can accompany IVs.\n- Because the findings were published in the news, some patients have chosen to use\n  another hospital in the region.\n	3	<p>A is irrelevant: how many legal documents had to be processed in one way or another is not going to have any effect on how many patients have health complications from IV therapy.</p><p>The hospital lowered the sodium and potassium to correct levels, so concentrations below baseline level are not the issue here.</p><p>This statement concerns folks who have completed their course of IV therapy, whereas this paradox to be resolved concerns folks who get complicationsduring their IV therapy.</p><p>D is the credited answer. If this hospital has more old folks, and old folks are more likely to have health complications from IV therapy, this would completely explain why this particular hospital has higher rates.</p><p>Some patients, hearing this news chose to go elsewhere. What does this imply for the rate of health complications among patients receiving IV therapy? That's unclear. Were the patients who still came to this hospital, on average, in better or worse health than the pool that typically would have come? Were there any commonalities among the health conditions of the folks who chose not to come to this hospital? We don't know. It's possible that, if we had more information, this statement could be relevant, but in the absence of clarification, this doesn't explain anything.</p>
81	2014-10-20 04:24:39.033734	2014-12-28 11:03:06.940302	Wolves can double their numbers every year. They do not do so, however, if the area in which they live is already full and the territory of each pack borders on the territory of other packs on all sides. Lone wolves, unable to establish a territory near their place of origin, disperse to a less desirable habitat and often are hunted by people. Which of the following conclusions may be properly drawn from the information in the passage above?\r\n	---\n- The number of wolves in any area suitable for wolves may be predicted to quadruple\n  in two years.\n- Wolves are ejected from the pack to wander singly as lone wolves when the number\n  of wolves in the pack has doubled.\n- The amount of territory suitable for wolves has been diminishing in recent years\n  as a result of human encroachment, with a resulting diminution in the wolf population.\n- Wolf hunting can continue at a moderate rate on the fringes of a good habitat for\n  wolves without a decrease in the average yearly wolf population in that territory.\n- The wolf population density in a given area of wolf territory does not vary with\n  the yearly rate of wolf reproduction.\n	3	<p>A. Although it is a conclusion that could be drawn from the quantitative information presented, this conclusion is contingent upon population density, mentioned in the second sentence of the paragraph.</p><p>B. It presents a faulty cause-and-effect relationship between doubling the population and the phenomenon of lone wolves.</p><p>C. The passage doesn't mention the encroachment of humans onto wolf territory.</p><p>D. This paragraph discusses factors that influence the wolf population. The apparently separate issue of the lone wolf is also introduced. It would seem that the most logical conclusion would attempt to tie these two ideas together. D is the best summary of the paragraph. It mentions wolf hunting as having little or no effect in fringe areas, which is true because only lone wolves live in these areas and thus hunting there would apparently have little effect on population numbers.</p><p>E. E contradicts the paragraph.</p>
